/*Table structure for table `alerts` */

DROP TABLE IF EXISTS `alerts`;

CREATE TABLE `alerts` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `subscriptionId` int(10) unsigned NOT NULL,
  `companyId` int(10) unsigned NOT NULL,
  `priceCondition` enum('movesAbove','movesBelow') COLLATE utf8_unicode_ci NOT NULL,
  `price` decimal(8,4) NOT NULL,
  `sentToSms` tinyint(1) NOT NULL DEFAULT '0',
  `sentToEmail` tinyint(1) NOT NULL DEFAULT '0',
  `sendSms` tinyint(1) NOT NULL DEFAULT '0',
  `sendEmail` tinyint(1) NOT NULL DEFAULT '0',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `alerts_companyid_pricecondition_subscriptionid_unique` (`companyId`,`priceCondition`,`subscriptionId`),
  KEY `alerts_subscriptionid_foreign` (`subscriptionId`),
  CONSTRAINT `alerts_companyid_foreign` FOREIGN KEY (`companyId`) REFERENCES `companies` (`id`),
  CONSTRAINT `alerts_subscriptionid_foreign` FOREIGN KEY (`subscriptionId`) REFERENCES `subscriptions` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=24 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

