/* Procedure structure for procedure `sp_aggregate_per_minute` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_aggregate_per_minute` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`pmorcilladev`@`%` PROCEDURE `sp_aggregate_per_minute`(
	IN var_symbol VARCHAR(255),
	IN var_price DECIMAL(16, 4),
	IN var_asOf DATETIME,
	IN var_percentChange DECIMAL(8, 4),
	IN var_volume INT(11),
	IN rawRecordId INT(11)
)
BEGIN
	SET @currentDate = (SELECT DATE_FORMAT(var_asOf, '%Y-%m-%d'));
	SET @companyId = (SELECT id FROM companies WHERE symbol = var_symbol);
	if ((SELECT COUNT(@companyId)) > 0) then
		SET @price = (SELECT `price` FROM aggregate_per_minute WHERE companyId = @companyId AND DATE_FORMAT(asOf, '%Y-%m-%d') = @currentDate ORDER BY id DESC LIMIT 1);
		SET @countRows = (SELECT COUNT(@price));
		IF (@countRows <= 0) THEN
			SET @price = 0.00;
		END IF;
		IF (var_price != @price) THEN
			INSERT INTO aggregate_per_minute(companyId, price, asOf, percentChange, volume, created_at)
				VALUES(@companyId, var_price, var_asOf, var_percentChange, var_volume, NOW());
			-- tag as materialized
			UPDATE raw_records SET materialized = 1 WHERE id = rawRecordId;
		END IF;
	end if;
END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_getActiveSubscription` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_getActiveSubscription` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`pmorcilladev`@`%` PROCEDURE `sp_getActiveSubscription`(
	IN var_userId INT(11)
    )
BEGIN
	SELECT subscriptionType, amountPaid, DATE_FORMAT(created_at, "%m-%d-%Y") AS subscriptionDate, DATE_FORMAT(validUntil, "%m-%d-%Y") AS expiryDate
		FROM subscriptions
		WHERE userId = var_userId
		ORDER BY id DESC LIMIT 1;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_materialize_per_company_daily` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_materialize_per_company_daily` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`pmorcilladev`@`%` PROCEDURE `sp_materialize_per_company_daily`(
	in var_symbol varchar(6),
	in var_openPrice decimal(16, 4),
	in var_highPrice decimal(16, 4),
	IN var_lowPrice DECIMAL(16, 4),
	IN var_closePrice DECIMAL(16, 4),
	in var_asOf date
    )
BEGIN
	set @companyId = (select id from companies where symbol = var_symbol);
	INSERT INTO materialize_per_company_daily(companyId, openPrice, highPrice, lowPrice, closePrice, asOf, created_at)
		VALUES(@companyId, var_openPrice, var_highPrice, var_lowPrice, var_closePrice, var_asOf, now())
		ON DUPLICATE KEY UPDATE openPrice = var_openPrice, highPrice = var_highPrice, lowPrice = var_lowPrice, closePrice = var_closePrice;
    END */$$
DELIMITER ;

/* Procedure structure for procedure `sp_perform_eod` */

/*!50003 DROP PROCEDURE IF EXISTS  `sp_perform_eod` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`pmorcilladev`@`%` PROCEDURE `sp_perform_eod`()
BEGIN
	SET @disabledEOD = (SELECT disable_eod FROM system_settings WHERE id = 1);
	IF (@disabledEOD = 0) THEN
		SET @unmaterializedDate = (SELECT DATE_FORMAT(asOf, '%Y-%m-%d') AS asOf FROM aggregate_per_minute WHERE materialized IS NULL OR materialized = 0 GROUP BY asOf ORDER BY asOf LIMIT 1);
		IF ((SELECT COUNT(@unmaterializedDate)) <= 0 ) THEN
			SET @last_eod = (SELECT DATE_FORMAT(MAX(asOf), '%Y-%m-%d') FROM aggregate_per_minute WHERE materialized IS NOT NULL OR materialized = 1);
			IF ((SELECT COUNT(@last_eod)) <= 0) THEN
				-- if all are materialized already
				UPDATE system_settings SET last_eod = @last_eod, last_exec_eod = NOW();
			END IF;
		END IF;
	END IF;
END */$$
DELIMITER ;

